public double dx1(double x11,double x21,double u11,double m,double g,double dc,double d1,double C,double J) {

	double sal1 = -(m*g*dc/J)*x21 - (C/J)*x11 + (d1/J)*u11;

	return sal1;
}

public double dc1(double c,double u) {

	double sal2 = -2*c + u;

	return sal2;
}

public double dh1(double h11,double uh11) {

	double sal2 = -0.2*h11 + uh11;

	return sal2;
}

public double dB2(double J1,double T1,double d11,double C1,double m1,double g1,double dc1,double B21,double B11) {

	double sal = ((T1*d11)/J1)-((C1/J1)*B21)-((m1*g1*dc1)/J1)*B11;
	return sal;
}

public double dM1(double rf1,double lf1,double M11,double km1,double vf1) {

	double sal1 = -(rf1/lf1)*M11 +(1/lf)*vf1;
	return sal1;
}

public double dtheta2(double f1,double j1,double theta21,double T21){

	double sal2 = -(f1/j1)*theta21 + (1/j1)*T21;
	return sal2;
}
